import React, { useState } from 'react';
import Calendar from 'react-calendar';
import './Calendario.css';

function Calendario() {
    return (
        <div className="containerNE">
            <div className="textNE">
                <h2 >Calendario</h2>
            </div>
            <div className="TimeNE">
                <div className="text_NE">
                    <h3>2021 - 10 - 24</h3>
                </div>
                <div className="text_NE">
                <Calendar
            onChange={onChange}
            showWeekNumbers
            value={value}
          />
                </div>
            </div>

        </div>
    );
}

export default Calendario;
